from skills import *

def find_tables_with_subnational_data(region_admin1_name):
    tables_with_ouaddai = []
    query_template = "SELECT table_name, columns FROM table_metadata WHERE columns LIKE ''%adm1_code%'' OR columns LIKE ''%adm1_name%''"
    tables = execute_query(query_template)
    
    for table in tables:
        table_name = table[0]
        columns = table[1]

        # Avoiding error in shapefiles table
        if table_name == "hdx_shape_files":
            continue
        try:
            admin_level_1_region = region_admin1_name if isinstance(region_admin1_name, list) else [region_admin1_name]
            ouaddai_query = f"SELECT DISTINCT adm1_name FROM {table_name} WHERE adm1_name ILIKE ANY(ARRAY{admin_level_1_region})"
            ouaddai_results = execute_query(ouaddai_query)
            if ouaddai_results:
                tables_with_ouaddai.append((table_name, columns))
        except Exception as e:
            print(f"Error executing query for table {table_name}: {str(e)}")
    
    return tables_with_ouaddai

