from sqlalchemy import create_engine
from dotenv import load_dotenv
from skills import *
from shapely import wkb
import matplotlib.pyplot as plt
import geopandas as gpd
import base64
import io

load_dotenv()

# Database connection details
DB_HOST = os.getenv("POSTGRES_DATA_HOST")
DB_PORT = os.getenv("POSTGRES_DATA_PORT")
DB_NAME = os.getenv("POSTGRES_DATA_DB")
DB_USER = os.getenv("POSTGRES_DATA_USER")
DB_PASSWORD = os.getenv("POSTGRES_DATA_PASSWORD")

# Create a database connection
engine = create_engine(f"postgresql://{DB_USER}:{DB_PASSWORD}@{DB_HOST}:{DB_PORT}/{DB_NAME}")

def plot_population_in_ipc3(admin_level_1_region, adm0_code, ipc_phase):
    # SQL query to fetch the required data
    query = f"""
    SELECT p.adm1_code, p.adm0_code, p.adm1_name, p.population_in_phase, g.geometry
    FROM hapi_food_food_security p
    JOIN hdx_shape_files g ON p.adm1_code = g.adm1_code
    WHERE p.adm0_code ILIKE ''{adm0_code}'' AND p.ipc_phase ILIKE ''{ipc_phase}'' AND p.ipc_type ILIKE ''current''
    """
    # Execute the query and fetch the data into a DataFrame
    df = pd.read_sql(query, engine)

    # Convert the ''geometry'' column into a GeoSeries
    df[''geometry''] = df[''geometry''].apply(lambda x: wkb.loads(x, hex=True))

    # Convert the DataFrame into a GeoDataFrame
    gdf = gpd.GeoDataFrame(df, geometry=''geometry'')

    # Plot the population in IPC3 for the specified admin level 1 region
    ax = gdf.plot(column=''population_in_phase'', cmap=''Blues'', linewidth=0.8, edgecolor=''0.8'', legend=True)
    ax.set_title(f"Population in IPC phase {ipc_phase} for {admin_level_1_region}")
    ax.set_xlabel("Longitude")
    ax.set_ylabel("Latitude")
    ax.axis(''off'')

    # Create a bytes buffer for the plot and save it to the buffer
    buf = io.BytesIO()
    plt.savefig(buf, format=''png'', dpi=300)
    plt.close()

    # Encode the bytes buffer in base64
    buf.seek(0)
    image_base64 = base64.b64encode(buf.read()).decode(''utf-8'')
    image_base64 = image_base64.replace(''\n'', '''')
    return image_base64

